/**
 * this component will be used to display the user's progress in the game
 * each time the user guesses a letter incorrectly, this will display will update to reflect that
 */
import './Display.css';
import hangman_states from '../../assets/hangman_states';
import { Image, Card } from 'react-bootstrap';

function Display() {
    return (
        <div className='display-content'>
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                    <Card.Text>
                        Some quick example text to build on the card title and make up the bulk of
                        the card's content.
                    </Card.Text>
                    <Card.Link href="#">Card Link</Card.Link>
                    <Card.Link href="#">Another Link</Card.Link>
                </Card.Body>
            </Card>
            <Image src={hangman_states[9]} />
        </div>
    );
}

export default Display;
